css:
/* i really want this to be global */

.btn-growth-lg,
.dark-theme .btn-growth-lg
{
  background-color: #A61;
  border-color: transparent !important;
}

.SalesText,
.text-robux,
.text-robux-lg,
span.robux
{
  color: #A61;
}

.btn-primary-md,
#item-container .btn-primary-lg,
.PurchaseButton:hover
{
  background-color: #A90 !important;
  border-color: transparent !important;
}

.icon-default-economy-28x28,
.icon-robux-28x28,
.icon-robux-gold-28x28,
.icon-robux,
span.icon-robux,
.icon-nav-robux,
.button:hover .icon-nav-robux,
a:hover .icon-nav-robux,
.item-cards-stackable.item-card-price.icon-robux,
.icon-robux-gray,
.robux-grid.cell-content.robux-title span[class^="icon"],
.icon-robux-16x16,
.icon-robux-gray-16x16,
span.robux,
div.robux,
.gotham-font.icon-robux-16x16,
.icon-robux-white
{
  background-image: url(https://cdn.discordapp.com/attachments/974660927926456350/1018746648727400569/3a9b44283e65ae1ead90defcb0bdcb6e-economy_28x28_dark_copia.png) !important;
  background-position: 0 !important;
}

#nav-robux
{
  background-image: url(https://cdn.discordapp.com/attachments/974660927926456350/1018746648727400569/3a9b44283e65ae1ead90defcb0bdcb6e-economy_28x28_dark_copia.png) !important;
  background-position: 0 !important;
}

#nav-robux:hover
{
  opacity: 0.75;
}

.light-theme .icon-default-economy-28x28, .light-theme .icon-robux-28x28, .light-theme .icon-robux-gold-28x28, .light-theme .icon-robux-white:hover
{
  background-size: 30px;
}

.light-theme .icon-robux-16x16, .robux-downsell .icon-robux-gray
{
  background-image: url(https://cdn.discordapp.com/attachments/974660927926456350/1018746648727400569/3a9b44283e65ae1ead90defcb0bdcb6e-economy_28x28_dark_copia.png)!important;
  background-position: 0;
  background-size: contain;
}

.light-theme .icon-robux-16x16, .robux-downsell .icon-robux-gray
{
  background-image: url(https://photos.google.com/photo/AF1QipPFrRu69bGz6RYXONnmMq_FaHIxxSUnqo6sZ4FI) !important;
  background-position: 0;
  background-size: contain;
}

.light-theme .text-robux-lg
{
  color: #cc9e71;
}

.light-theme .text-robux-tile
{
  color: #cc9e71;
}

.light-theme .text-robux-tile
{
  color: #cc9e71;
}

.light-theme .text-robux-tile
{
  color: rgba(0,0,0,.6);
}

.text-robux, .text-robux-tile
{
  color: #cc9e71;
  font-weight: 500;
}
